import React from 'react';

const ProgressBar = ({ progress }) => {
    const Parentdiv = {
        display: 'flex',
        justifyContent: 'center', // Centers the child horizontally
        alignItems: 'center', // Centers the child vertically if needed
        height: '100vh', // Takes full viewport height, adjust as needed
        height: 15,
        width: '90%',
        backgroundColor: 'whitesmoke',
        borderRadius: 40,
        margin: 30
    }

    const Childdiv = {
        height: '100%',
        width: `${progress}%`,
        backgroundColor: 'green',
        borderRadius: 40,
        textAlign: 'right'
    }

    const progresstext = {
        color: 'white',
        fontWeight: 500
    }

    return (
        <div style={Parentdiv}>
            <div style={Childdiv}>
                <span style={progresstext}>{`${progress}%`}</span>
            </div>
        </div>
    )

};

export default ProgressBar;
